<div class="entities" style="line-height: 2.5; direction: ltr">Effect of milk hydrolysates on inflammation markers and drug-induced transcriptional alterations in cell-based models . Nonsteroidal anti-inflammatory drugs ( NSAID ) are associated with gastrointestinal inflammation and subsequent damage to the intestinal tissue . Earlier studies in our laboratory have found that specific casein hydrolysates ( CH ) might be useful in the treatment of gastrointestinal wounds . The underlying mechanisms that support inflammation and wound healing are not completely understood , but transcriptional alterations may be used as markers for inflammation and wound healing . The bioactivity of 3 CH prepared by treatment of commercial casein with pepsin ( 60 min ) followed by corolase ( 0 , 10 , or 60 min ) were investigated in intestinal epithelial cells treated with the NSAID indomethacin . The bioactivity was evaluated as transcriptional alterations of transforming growth factor- 1 ( TGF- 1 ) , cyclooxygenase - 2 (

<div class="entities" style="line-height: 2.5; direction: ltr">Leukotriene D4 - induced increases in cytosolic calcium in THP - 1 cells : dependence on extracellular calcium and inhibition with selective leukotriene D4 receptor antagonists . Agonist-induced changes in intracellular calcium ion concentration ( [ Ca + + ] i ) were examined in human monocytic leukemia THP - 1 cells loaded with fura 2 / acetoxymethyl ester ( fura 2 / AM ) . Leukotriene ( LT ) D4 induced a concentration-dependent biphasic response consisting of a transient phase ( up to 5 - fold peak increase ) followed by a sustained phase , showing characteristics of a receptor-operated calcium channel . Homologous desensitization to LTD 4 was observed . The responses to LTD 4 were reduced by 80 to 90 % in calcium-free buffer . The responses to LTD 4 in a calcium-free buffer were dependent upon the duration of prior exposure of the cells to a calcium-free environment . The response at 30 or 60 min after exposure to calcium-free buffer was greater than that at earlier time points ( time-dependent sensitization ) . Similar responses were obtained with THP - 1 cells exposed to DB00974 - containing buffer . It is speculated that such time-dependent sensitization is a result of changes at the receptor level . The responses to LTD 4 were blocked by two specific LTD 4 antagonists , MK - 0571 and

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Determination of fenofibric acid concentrations by HPLC after anion exchange solid-phase extraction from human serum . Triglycerides are increasingly being recognized as a risk factor for cardiovascular disease . Research efforts to identify sources of variability in triglyceride-lowering response to the lipid-lowering drug fenofibrate require quantification of the active acidic form of this 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q07869
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 agonist . Anion-exchange solid-phase extraction , in combination with reverse-phase high-performance liquid chromatography ( HPLC ) , rapidly and accurately determines steady-state fenofibric acid serum concentrations . Chromatographic separation under isocratic conditions , with use of ultraviolet detection at 285 nm , provides clean baseline and sharp peaks for clofibric acid , 1 - napthyl acetic acid ( internal standards ) , and fenofibric acid . Commonly prescribed and over-the-counter nonsteroidal anti-inflammatory drugs ( NSAIDs ) were screened for assay interference , and the assay was employed to quantify fenofibric acid in more than 800 human subject specimens . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01039
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 analysis was found to be linear over the range of 0.5 to 40 mg / L and was validated with either internal standard . Accuracies ranged from 98.65 % to 102.4 % , whereas the within - and between-day precisions ranged from 1.0 % to 2.2 % and 2.0 % to 6.2 % , respectively . NSAIDs had minimal interference with the assay , which succeeded in quantifying fenofibric acid in more than 843 of 846 serum samples from human subjects , many taking a variety of coadministered medications . Anion-exchange solid-phase extraction in combination with reverse-phase HPLC accurately determines steady-state fenofibric acid serum concentrations in humans without interference from NSAIDs or commonly administered medications . This method is suitable for quantification of fenofibric acid for clinical pharmacokinetic studies in patients with dyslipidemia .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Pharmacological investigation of the role of leukotrienes in the pathogenesis of experimental NSAID gastropathy . The role of leukotrienes in the pathogenesis of acute gastric ulceration induced by nonsteroidal antiinflammatory drugs was investigated using a rat model . One part of the study involved oral pretreatment with a leukotriene synthesis inhibitor 1 h prior to administration of indomethacin ( 20 mg / kg per os ) . Three hours after indomethacin , the extent of macroscopically visible gastric damage was determined , and gastric LTB 4 synthesis was determined . The compounds tested were PF - 5901 , A - 64077 , nordihydroguaiaretic acid , and L -698,037 . Each compound produced dose-related inhibition of gastric LTB 4 synthesis and a parallel reduction in the severity of indomethacin-induced damage . The antioxidant properties of these compounds was assessed using an in vitro assay . There was no correlation between the antioxidant properties of the compounds and their ability to reduce the severity of indomethacin-induced gastric damage . In the second part of the study , the effects of intravenous , administration of LTD 4 and LTB 4 receptor antagonists on indomethacin-induced gastric epithelial damage ( measured by permeability to [ 51Cr ] DB00974 ) were assessed . The two 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9Y271
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonists ( MK - 571 and 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00549
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 ) significantly reduced the permeability changes induced by indomethacin , while the two LTB 4 antagonists ( SC - 41930 and LY -255,283 ) were without significant effect . Despite the reduction of gastric epithelial injury , blockade of LTD 4 receptors did not markedly affect the extent of macroscopically visible injury . These data are consistent with the hypothesis that leukotrienes contribute to the epithelial injury and macroscopically visible damage induced by NSAIDs . However , it remains unclear to what extent leukotrienes are involved in the initiation of the injury , as opposed to its amplification .</div>
